});



class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>

 <button
          className="button is-primary"
          onSubmit={this.handleDonationSubmit}>
          create wallet
        </button>        
        </header>
      </div>
    );
  }
}

